import Header from './components/Header/Header';
import Login from './pages/login/Login';

const App = () => {
  const auth = localStorage.getItem('auth');
  const [user, setUser] = React.useState(null);

  React.useEffect(() => {
    setUser(JSON.parse(auth));
  },[]);
  
